import Navbar from '../components/Navbar/Navbar'; 
import Background from '../components/Background/Background';
import Cards from '../components/Cards/Cards';
import './PageOne.css';
import Footer from '../components/Footer/Footer';
import fatma from '../assets/fatma.jpg';
import yosra from '../assets/yosra.jpg';


function PageOne() {
  return (
    <div className="page">
      <Navbar />
      <Background/>
      <div className="cards-container">
      <div>
      {/* Première carte avec ses liens */}
      <Cards
        profileImage="fatma"
        githubLink="https://l.facebook.com/l.php?u=https%3A%2F%2Fgithub.com%2Fyosraomran%3Ffbclid%3DIwZXh0bgNhZW0CMTAAAR3rXCdA6Hy7OsEaQZ7xCr_VMAmgUgH4YRTy_npNv_AAvsZgWmFZJxkKF0k_aem_Ac3QVefwvFwXgwZV-6snsKa8w__-yd9nZlIbM7xYIQbxaPBKNEJrVHixKnKyYFx8K4ZHdRc-6ZdEPY-Lc4vplBpb&h=AT3SDw3UzvQIwaeZN2_7wwxoxo26VyTT7F4VmJo8MMK9CVFyqQLtHjhhuRiD8xQll-gwFpV8eWPrESKIvp2YwuRLf7-jsmlO4NHxQC0B0LowT06Wdwn4hECGmNwo1u6z8UZcig"
        linkedinLink="https://l.facebook.com/l.php?u=https%3A%2F%2Fwww.linkedin.com%2Fin%2Fyosra-omrane-748a37209%2F%3Ffbclid%3DIwZXh0bgNhZW0CMTAAAR3PUDyirHa7YT92HsnXwEULCeImsx_TUYLBeaWNfboSVCKbX02IePZxROQ_aem_Ac1JlUmv5dpMMM1mT2ugxHBmW8anKqstzh_9VZzL-4Y2JRzE-ODSzUnbc1duBHpCI0b3XdAe8LO2_qHdT4FX1Izm&h=AT3SDw3UzvQIwaeZN2_7wwxoxo26VyTT7F4VmJo8MMK9CVFyqQLtHjhhuRiD8xQll-gwFpV8eWPrESKIvp2YwuRLf7-jsmlO4NHxQC0B0LowT06Wdwn4hECGmNwo1u6z8UZcig"
      />

      {/* Deuxième carte avec ses liens */}
      <Cards
        profileImage="yosra"
        githubLink="lien_vers_profil_github_2"
        linkedinLink="lien_vers_profil_linkedin_2"
      />

      {/* Troisième carte avec ses liens */}
      <Cards
        profileImage="yosra"
        githubLink="lien_vers_profil_github_3"
        linkedinLink="lien_vers_profil_linkedin_3"
      />

      {/* Quatrième carte avec ses liens */}
      <Cards
        profileImage="yosra"
        githubLink="lien_vers_profil_github_4"
        linkedinLink="lien_vers_profil_linkedin_4"
      />
    </div>
    </div>
      <Footer/> 
    </div>
  );
}

export default PageOne;
